long_desc.thetext:
The bug 213731 ("[sec] Implement keyring-like functionality") can benefit from using Windows Data Protection mechanism. 

The attached C++ project contains source and DLL to access user-specific encryption provided by CryptProtectData(). 

The encrypted data is encoded as Base64 for easy handling and passed back to Java. Later data can be decoded by the same user. 

The Java stub is:

package org.eclipse.equinox.internal.security.accounts;
public class WinCrypto {
	public native String encrypt(String value);
	public native String decrypt(String value);
	static {
		System.loadLibrary("jnicrypt");
	}
}

See readme.txt on the notes on compilation and usage.
